import React, { Component } from "react";
// import myText from "../../api/debug";

export default class LiveLog extends Component {
  render() {
    return (
      <div>
        <button
          onClick={this.handleClick}
          className="LoadMyFile"
          name="button"
          variant="flat"
        >
          test string
        </button>
      </div>
    );
  }
  handleClick = () => {
    fetch("./test.txt")
      .then((r) => r.text())
      .then((text) => {
        console.log(text);
      });
  };
}
